import React from 'react';
import './styles.scss';
import { howWeDoIt } from './info';
import CardWithBorder from '../../../../components/CardWithBorder/CardWithBorder';

export default function HowWeDoIt() {
  return (
    <section className="HWDI">
      {howWeDoIt.map((card) => {
        return (
          <>
            <CardWithBorder
              title={card.title}
              image={card.image}
              text={card.text}
            />
          </>
        );
      })}
    </section>
  );
}
